import styled from 'styled-components';

export const Container = styled.div`
 position:relative ;
 display: inline-block;
 margin:30px;
 width:350px;
 height: 550px;
 border-radius: 10px;
 background-color: #333;

 img{
     position: relative;
     bottom:30px;
     width:350px;
     border-radius:19px;
 }
 h3{
     font-family: 'Hina Mincho';
     position: relative;
     bottom: 35px;
     right: 70px;
 }
 p{
    font-family: 'Hina Mincho';
     position: relative;
     bottom: 35px;
     box-shadow: 0 3px 15px rgb(7, 7, 7);
     color:rgb(123, 128, 154);
     border
 }
`;
